Ballerina provides support for interacting with a transaction manager. Compile-time guarantees that transactions are bracketed with begin and commit or rollback. The region in the middle is typed as being a transactional context. Ballerina does not have a transactional memory and includes a transaction manager. The current transaction is a part of the execution context of a strand. import ballerina/io; public function main() returns error? { // Compile-time guarantees that transactions are bracketed with // begin and commit or rollback. Transaction statement begins // a new transaction and executes a block. transaction { doStage1(); doStage2(); // Commit of a transaction must be done explicitly using commit. // Commit must be lexically within a transaction statement and may // return an error; check commit; } return;
} function doStage1() { io:println("Stage1 completed");
} function doStage2() { io:println("Stage2 completed");
} Output bal run transaction_statement.bal
