isolated is a complex feature, which would be a lot for an application developer to understand. A typical Ballerina application consists of a single module that imports multiple library modules. Within a single module, the compiler infers isolated qualifiers. An object without mutable fields is inherently isolated. It is the application developer's responsibility to use lock statements where needed. e.g., accessing `self` in a `service` object with mutable state accessing mutable module-level variables Compiler can inform developer where missing locks are preventing a `service` object or method from being `isolated`. import ballerina/io; public function main() { // function's default worker, worker `A` and `B` run concurrently. worker A { // It is safe to access the parameters of `sayHello` for the // duration of the function call. string a = sayHello("John"); io:println(a); } worker B { string b = sayHello("Anne"); io:println(b); } // `sayHello` is inferred to be an `isolated` function. boolean c = sayHello is isolated function (string str) returns string; io:println(c);
} function sayHello(string name) returns string { return "Hello " + name;
} Output bal run inferring_isolated.bal
