// endpoint, the service will be accessible at the specified path. If the path is omitted, then it defaults to `/`.
// A string literal also can represent the absolute path. E.g., `"/foo"`.
// The `type descriptor` represents the respective type of the service. E.g., `http:Service`.
service http:Service /foo on new http:Listener(9090) { // The `resource method name` (`post`) confines the resource to the specified HTTP methods. In this // instance, only `POST` requests are allowed. The `default` accessor can be used to match with all methods // including standard HTTP methods and custom methods. // The `resource path` associates the relative path to the service object's path. E.g., `bar`. resource function post bar(@http:Payload json payload) returns json { return payload; }
