caller->pushPromisedResponse(promise2, push2); if (pushResponse2 is error) { log:printError("Error occurred while sending the promised " + "response2", 'error = pushResponse2); } // Construct promised resource3. http:Response push3 = new; msg = {"push": {"name": "resource3"}}; push3.setPayload(msg); // Push promised resource3. var pushResponse3 = caller->pushPromisedResponse(promise3, push3); if (pushResponse3 is error) { log:printError("Error occurred while sending the promised " + "response3", 'error = pushResponse3); } }
