This is an example, which creates a Kafka consumer used as a listener to a service with manual offset commits. This consumer uses the builtin int deserializer for the keys and the builtin string deserializer for the values. For this example to work properly, an active Kafka broker should be present. For more information on the underlying module, see the Kafka module . import ballerinax/kafka;
import ballerina/log; kafka:ConsumerConfiguration consumerConfigs = { groupId: "group-id", // Subscribes to the topic `test-kafka-topic`. topics: ["test-kafka-topic"], pollingInterval: 1, // Sets the `autoCommit` to `false` so that the records should be committed manually. autoCommit: false
