} function hmac() returns error? { // Input value for HMAC operations. string value = "Hello Ballerina!"; byte[] input = value.toBytes(); // The key used for the HMAC generation. string secret = "somesecret"; byte[] key = secret.toBytes(); // HMAC generation for the input value using the MD5 hashing algorithm, and printing the HMAC value using the Hex encoding. byte[] output = check crypto:hmacMd5(input, key); io:println("Hex encoded HMAC with MD5: " + output.toBase16()); // HMAC generation for input the value using the SHA1 hashing algorithm, and printing the HMAC value using the Base64 encoding. output = check crypto:hmacSha1(input, key); io:println("Base64 encoded HMAC with SHA1: " + output.toBase64()); // HMAC generation for the input value using the SHA256 hashing algorithm, and printing the HMAC value using the Hex encoding. output = check crypto:hmacSha256(input, key); io:println("Hex encoded HMAC with SHA256: " + output.toBase16()); // HMAC generation for the input value using the SHA384 hashing algorithm, and printing the HMAC value using the Base64 encoding. output = check crypto:hmacSha384(input, key); io:println("Base64 encoded HMAC with SHA384: " + output.toBase64()); // HMAC generation for the input value using the SHA512 hashing algorithm, and printing the HMAC value using the Hex encoding. output = check crypto:hmacSha512(input, key); io:println("Hex encoded HMAC with SHA512: " + output.toBase16());
} function decodePrivateKey() returns crypto:PrivateKey|error { // Obtaining the reference to an RSA private key by a key file. string keyFile = "../resource/path/to/private.key"; crypto:PrivateKey privateKey = check crypto:decodeRsaPrivateKeyFromKeyFile(keyFile); // Obtaining the reference to an RSA private key by an encrypted key file. string encryptedKeyFile = "../resource/path/to/encryptedPrivate.key"; privateKey = check crypto:decodeRsaPrivateKeyFromKeyFile(encryptedKeyFile, "ballerina"); // Obtaining the reference to an RSA private key stored within a PKCS#12 or PFX format archive file. crypto:KeyStore keyStore = { path: "../resource/path/to/ballerinaKeystore.p12", password: "ballerina" }; privateKey = check crypto:decodeRsaPrivateKeyFromKeyStore(keyStore, "ballerina", "ballerina"); return privateKey;
